!function($){$.widget("ui.timespinner",$.ui.spinner,{options:{step:60,page:60,format:"HH:mm"},_parse:function(value){return"string"==typeof value?Number(value)==value?Number(value):moment.utc(value,this.options.format).unix():value},_format:function(value){return moment.unix(value).utc().format(this.options.format)}})}(jQuery);